description:
Jamaica's Underground Gays

Sociopolitical Documentary hosted by Ade Adepitan, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2014 - English narration


Information
------------------------------

Jamaica has a reputation for intolerance of homosexuality. Male gay sex is punishable by 10 years' hard labour and violent hostility is entrenched in the island's culture. In an eye-opening episode, reporter Ade Adepitan and director Andrew Carter travel to Kingston to investigate the growth of homophobic attacks in Jamaica and to meet the gay and transgender group who've ended up living in a storm drain, where they suffer shocking violence, attacks and insults because of their sexuality.

